import React from 'react';
import {ProductConsumer} from "../../context";
import CartItem from "./CartItem";

function CartList() {
    return (
        <ProductConsumer>
            {
                value => {
                    const {cart} = value;
                    {cart.map(item => {
                        return <CartItem value={value} item={item} />
                    })}
                }
            }
        </ProductConsumer>

    );
}

export default CartList();
